import styles from './Navbar.module.scss';

const Nav = () => {
  <div className={styles.topnav}>
    <a className={styles.active} href="#home">
      Home
    </a>
    <a href="#news">News</a>
    <a href="#contact">Contact</a>
    <a href="#about">About</a>
  </div>;
};

export default Nav;
